import React from 'react';
import { Carousel, Container, Row, Col } from 'react-bootstrap';
import item1 from '../pictures/photo.jpg';
import item2 from '../pictures/barber.jpg';
import item3 from '../pictures/beard trimming.jpg';
import logo from '../pictures/head.png';
import styled from 'styled-components';

const Styles = styled.div`

.container {
  display: flex;
  position: relative;
  left: 0px;
  top: 0px;
  z-index: 2;
  
  p {
    font-size: 5em;
    text-shadow: 0.25em 0.25em #000;
  }
}

.bg {
  z-index: 1;
  position: absolute;
  heigth: 100%
}

`

function Home() {
  return (
    <Styles id="home">
      <Carousel>
        <Carousel.Item>
          <img
            className="d-block w-100 bg"
            src={item1}
            alt="Second slide"
          />
          <Container>
            <Row>
              <Col>
                <p>Barber</p>
              </Col>
              <Col>
                <img
                  className="d-block w-100"
                  src={logo}
                  alt="Second slide"
                />
              </Col>
              <Col>
                <p>Andrew</p>
              </Col>
            </Row>
          </Container>
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={item2}
            alt="Second slide"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={item3}
            alt="Third slide"
          />
        </Carousel.Item>
      </Carousel>
    </Styles>

  )
}

export default Home;
